"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[883],{3883:a=>{a.exports=JSON.parse('{"5":{"words":[{"spanish":"La casa","english":"The house"},{"spanish":"El apartamento","english":"The apartment"},{"spanish":"El cuarto","english":"The room"},{"spanish":"La cocina","english":"The kitchen"},{"spanish":"El ba\xf1o","english":"The bathroom"},{"spanish":"La sala","english":"The living room"},{"spanish":"El comedor","english":"The dining room"},{"spanish":"El dormitorio","english":"The bedroom"},{"spanish":"El jard\xedn","english":"The garden"},{"spanish":"El balc\xf3n","english":"The balcony"},{"spanish":"La cama","english":"The bed"},{"spanish":"La mesa","english":"The table"},{"spanish":"La silla","english":"The chair"},{"spanish":"El sof\xe1","english":"The sofa"},{"spanish":"El escritorio","english":"The desk"},{"spanish":"El armario","english":"The closet"},{"spanish":"La l\xe1mpara","english":"The lamp"},{"spanish":"El espejo","english":"The mirror"},{"spanish":"El suelo","english":"The floor"},{"spanish":"La ventana","english":"The window"},{"spanish":"La puerta","english":"The door"},{"spanish":"La lavadora","english":"The washing machine"},{"spanish":"El horno","english":"The oven"},{"spanish":"El lavaplatos","english":"The dishwasher"},{"spanish":"Yo limpio","english":"I clean"},{"spanish":"\xc9l barre el suelo","english":"He sweeps the floor"},{"spanish":"Ella hace la cama","english":"She makes the bed"},{"spanish":"Nosotros lavamos la ropa","english":"We wash the clothes"},{"spanish":"Yo paso la aspiradora","english":"I vacuum"},{"spanish":"T\xfa riegas las plantas","english":"You water the plants"},{"spanish":"Yo abro la ventana","english":"I open the window"},{"spanish":"Ella cierra la puerta","english":"She closes the door"},{"spanish":"Nosotros cenamos","english":"We have dinner"},{"spanish":"\xc9l descansa","english":"He rests"},{"spanish":"T\xfa estudias en el escritorio","english":"You study at the desk"},{"spanish":"Ellos duermen","english":"They sleep"},{"spanish":"La alfombra","english":"The rug"},{"spanish":"El cuadro","english":"The painting"},{"spanish":"El pasillo","english":"The hallway"},{"spanish":"La pared","english":"The wall"}],"conversations":[{"id":1,"topic":"Describiendo la casa","dialog":[{"speaker":"Elena","spanish":"\xbfC\xf3mo es tu nueva casa?","english":"What is your new house like?"},{"speaker":"Mario","spanish":"Es grande. Tiene un jard\xedn y un balc\xf3n.","english":"It\'s big. It has a garden and a balcony."},{"speaker":"Elena","spanish":"\xa1Qu\xe9 bien! Mi apartamento no tiene jard\xedn. Solo tiene un balc\xf3n peque\xf1o.","english":"How nice! My apartment doesn\'t have a garden. It only has a small balcony."},{"speaker":"Mario","spanish":"\xbfCu\xe1ntos dormitorios tiene?","english":"How many bedrooms does it have?"},{"speaker":"Elena","spanish":"Tiene tres dormitorios. El pasillo es muy largo.","english":"It has three bedrooms. The hallway is very long."}],"questions":[{"question":"\xbfQu\xe9 tiene la casa de Mario?","options":["Un garaje","Un jard\xedn y un balc\xf3n","Un pasillo largo","Un s\xf3tano"],"answer":"Un jard\xedn y un balc\xf3n","answerIndex":1},{"question":"\xbfCu\xe1ntos dormitorios tiene el apartamento de Elena?","options":["Uno","Dos","Tres","Cuatro"],"answer":"Tres","answerIndex":2},{"question":"\xbfQu\xe9 significa \'El pasillo es muy largo\'?","options":["The hallway is very short","The hallway is very long","The kitchen is very big","The balcony is very small"],"answer":"The hallway is very long","answerIndex":1}]},{"id":2,"topic":"Hablando de quehaceres","dialog":[{"speaker":"Sof\xeda","spanish":"Mi casa est\xe1 muy sucia. Tengo que barrer el suelo.","english":"My house is very dirty. I have to sweep the floor."},{"speaker":"Pablo","spanish":"Yo tengo que pasar la aspiradora en la alfombra de la sala.","english":"I have to vacuum the living room rug."},{"speaker":"Sof\xeda","spanish":"\xbfY la ropa? \xbfLavas la ropa hoy?","english":"And the clothes? Are you washing the clothes today?"},{"speaker":"Pablo","spanish":"S\xed, mi madre y yo lavamos la ropa y luego la tendemos en el balc\xf3n.","english":"Yes, my mother and I wash the clothes and then we hang them on the balcony."},{"speaker":"Sof\xeda","spanish":"Yo no tengo balc\xf3n. Tiendo la ropa en el jard\xedn.","english":"I don\'t have a balcony. I hang the clothes in the garden."}],"questions":[{"question":"\xbfQu\xe9 tiene que barrer Sof\xeda?","options":["La alfombra","El suelo","La mesa","La cama"],"answer":"El suelo","answerIndex":1},{"question":"\xbfD\xf3nde tiende la ropa Pablo?","options":["En el jard\xedn","En el balc\xf3n","En el cuarto","En la cocina"],"answer":"En el balc\xf3n","answerIndex":1},{"question":"\xbfQu\xe9 significa \'pasar la aspiradora\'?","options":["To sweep","To wash the dishes","To vacuum","To cook"],"answer":"To vacuum","answerIndex":2}]},{"id":3,"topic":"Objetos de la casa","dialog":[{"speaker":"Andr\xe9s","spanish":"\xbfQu\xe9 hay en la sala de tu casa?","english":"What is in the living room of your house?"},{"speaker":"Clara","spanish":"Hay un sof\xe1 grande, una mesa peque\xf1a y un cuadro en la pared.","english":"There is a big sofa, a small table, and a painting on the wall."},{"speaker":"Andr\xe9s","spanish":"\xbfY en tu dormitorio? \xbfQu\xe9 hay en tu dormitorio?","english":"And in your bedroom? What is in your bedroom?"},{"speaker":"Clara","spanish":"En mi dormitorio hay una cama, un escritorio y una l\xe1mpara.","english":"In my bedroom there is a bed, a desk, and a lamp."},{"speaker":"Andr\xe9s","spanish":"\xbfUsas el escritorio para trabajar?","english":"Do you use the desk to work?"},{"speaker":"Clara","spanish":"S\xed, trabajo en el escritorio y a veces leo libros.","english":"Yes, I work at the desk and sometimes I read books."}],"questions":[{"question":"\xbfQu\xe9 hay en la sala de Clara?","options":["Una cama","Una l\xe1mpara","Un sof\xe1 y un cuadro","Un espejo"],"answer":"Un sof\xe1 y un cuadro","answerIndex":2},{"question":"\xbfQu\xe9 usa Clara para trabajar?","options":["La cama","El sof\xe1","La l\xe1mpara","El escritorio"],"answer":"El escritorio","answerIndex":3},{"question":"\xbfQu\xe9 significa \'la pared\'?","options":["The floor","The door","The wall","The window"],"answer":"The wall","answerIndex":2}]},{"id":4,"topic":"La cocina y la comida","dialog":[{"speaker":"Beatriz","spanish":"Necesito cocinar, pero el horno no funciona.","english":"I need to cook, but the oven is not working."},{"speaker":"Jorge","spanish":"Qu\xe9 mal. \xbfY el lavaplatos funciona?","english":"That\'s bad. And does the dishwasher work?"},{"speaker":"Beatriz","spanish":"S\xed, el lavaplatos funciona. Es muy \xfatil.","english":"Yes, the dishwasher works. It is very useful."},{"speaker":"Jorge","spanish":"\xbfQu\xe9 vas a cocinar si el horno no funciona?","english":"What are you going to cook if the oven is not working?"},{"speaker":"Beatriz","spanish":"Voy a usar la estufa para hacer sopa.","english":"I am going to use the stove to make soup."}],"questions":[{"question":"\xbfQu\xe9 electrodom\xe9stico no funciona para Beatriz?","options":["El horno","El lavaplatos","La estufa","El refrigerador"],"answer":"El horno","answerIndex":0},{"question":"\xbfQu\xe9 va a usar Beatriz para cocinar?","options":["El lavaplatos","El horno","La estufa","El microondas"],"answer":"La estufa","answerIndex":2},{"question":"\xbfQu\xe9 significa \'el lavaplatos\'?","options":["The sink","The dishwasher","The oven","The plate"],"answer":"The dishwasher","answerIndex":1}]},{"id":5,"topic":"Actividades en la casa","dialog":[{"speaker":"Daniela","spanish":"\xbfQu\xe9 est\xe1s haciendo en el jard\xedn, Mateo?","english":"What are you doing in the garden, Mateo?"},{"speaker":"Mateo","spanish":"Estoy regando las plantas. Mi madre me ayuda.","english":"I\'m watering the plants. My mother helps me."},{"speaker":"Daniela","spanish":"Qu\xe9 bien. Yo estoy en el balc\xf3n, leyendo un libro.","english":"How nice. I am on the balcony, reading a book."},{"speaker":"Mateo","spanish":"\xbfY por la noche?","english":"And at night?"},{"speaker":"Daniela","spanish":"Por la noche, yo descanso en el sof\xe1 de la sala.","english":"At night, I rest on the sofa in the living room."}],"questions":[{"question":"\xbfQu\xe9 est\xe1 haciendo Mateo en el jard\xedn?","options":["Limpiando la casa","Leyendo un libro","Regando las plantas","Descansando en el sof\xe1"],"answer":"Regando las plantas","answerIndex":2},{"question":"\xbfQu\xe9 hace Daniela en el balc\xf3n?","options":["Riega las plantas","Lee un libro","Limpia","Ve televisi\xf3n"],"answer":"Lee un libro","answerIndex":1},{"question":"\xbfQu\xe9 significa \'regando las plantas\'?","options":["Watering the plants","Planting the flowers","Cutting the grass","Picking the fruits"],"answer":"Watering the plants","answerIndex":0}]}],"stories":[{"id":1,"title":"Mi Nueva Casa","sentences":[{"spanish":"Me mud\xe9 a una nueva casa el mes pasado. Es grande y bonita.","english":"I moved into a new house last month. It\'s big and beautiful."},{"spanish":"Mi casa tiene un jard\xedn grande y un garaje para el carro.","english":"My house has a big garden and a garage for the car."},{"spanish":"En la entrada, hay un pasillo largo que lleva a la sala.","english":"In the entrance, there is a long hallway that leads to the living room."},{"spanish":"La sala tiene dos sof\xe1s y un cuadro en la pared.","english":"The living room has two sofas and a painting on the wall."},{"spanish":"En el dormitorio principal, hay una cama enorme y un armario grande.","english":"In the main bedroom, there is a huge bed and a big closet."},{"spanish":"La cocina tiene una estufa nueva y un lavaplatos moderno.","english":"The kitchen has a new stove and a modern dishwasher."},{"spanish":"Estoy muy feliz de vivir en mi nueva casa.","english":"I am very happy to live in my new house."}]},{"id":2,"title":"Un D\xeda de Limpieza","sentences":[{"spanish":"El s\xe1bado es el d\xeda para limpiar la casa.","english":"Saturday is the day to clean the house."},{"spanish":"Primero, yo me levanto y hago la cama en mi dormitorio.","english":"First, I get up and make the bed in my bedroom."},{"spanish":"Luego, mi hermano y yo barremos el suelo del comedor.","english":"Then, my brother and I sweep the dining room floor."},{"spanish":"Mi padre pasa la aspiradora en la alfombra de la sala.","english":"My father vacuums the living room rug."},{"spanish":"Mi madre lava la ropa en la lavadora.","english":"My mother washes the clothes in the washing machine."},{"spanish":"Yo tiendo la ropa en el balc\xf3n para que se seque.","english":"I hang the clothes on the balcony to dry."},{"spanish":"Es mucho trabajo, pero la casa est\xe1 limpia al final del d\xeda.","english":"It\'s a lot of work, but the house is clean at the end of the day."}]},{"id":3,"title":"Una Noche Tranquila","sentences":[{"spanish":"Mi noche empieza despu\xe9s de la cena. Mi hermana y yo lavamos los platos.","english":"My evening starts after dinner. My sister and I wash the dishes."},{"spanish":"Despu\xe9s, yo descanso en el sof\xe1 de la sala. Es mi lugar favorito.","english":"Afterwards, I rest on the sofa in the living room. It\'s my favorite place."},{"spanish":"Veo una pel\xedcula en la televisi\xf3n que est\xe1 en la pared.","english":"I watch a movie on the television that is on the wall."},{"spanish":"Mi madre se sienta en una silla y lee un libro.","english":"My mother sits in a chair and reads a book."},{"spanish":"A las diez, me voy a mi dormitorio. Cierro la puerta.","english":"At ten, I go to my bedroom. I close the door."},{"spanish":"Abro la ventana para que entre aire fresco.","english":"I open the window so that fresh air comes in."},{"spanish":"Me acuesto en mi cama, apago la l\xe1mpara y duermo.","english":"I lie down in my bed, turn off the lamp, and sleep."}]}],"speaking":{"title":"En la Casa","description":"Preguntas y respuestas sobre las partes de la casa, los muebles y las tareas del hogar.","questions_and_answers":[{"question":{"spanish":"\xbfVives en una casa o en un apartamento?","english":"Do you live in a house or an apartment?"},"answer":{"spanish":"Yo vivo en un apartamento peque\xf1o.","english":"I live in a small apartment."}},{"question":{"spanish":"\xbfQu\xe9 hay en tu dormitorio?","english":"What is in your bedroom?"},"answer":{"spanish":"Hay una cama, un escritorio y una l\xe1mpara.","english":"There is a bed, a desk, and a lamp."}},{"question":{"spanish":"\xbfQu\xe9 hay en la sala?","english":"What is in the living room?"},"answer":{"spanish":"Hay un sof\xe1 y un cuadro en la pared.","english":"There is a sofa and a painting on the wall."}},{"question":{"spanish":"\xbfQui\xe9n hace la cama?","english":"Who makes the bed?"},"answer":{"spanish":"Yo hago la cama todos los d\xedas.","english":"I make the bed every day."}},{"question":{"spanish":"\xbfBarres el suelo o pasas la aspiradora?","english":"Do you sweep the floor or vacuum?"},"answer":{"spanish":"Yo paso la aspiradora en el suelo.","english":"I vacuum the floor."}},{"question":{"spanish":"\xbfTienes un jard\xedn?","english":"Do you have a garden?"},"answer":{"spanish":"S\xed, mi casa tiene un jard\xedn grande.","english":"Yes, my house has a big garden."}},{"question":{"spanish":"\xbfHay un balc\xf3n en tu casa?","english":"Is there a balcony in your house?"},"answer":{"spanish":"S\xed, hay un balc\xf3n peque\xf1o en mi apartamento.","english":"Yes, there is a small balcony in my apartment."}},{"question":{"spanish":"\xbfD\xf3nde lavas la ropa?","english":"Where do you wash the clothes?"},"answer":{"spanish":"Yo lavo la ropa en la lavadora en el ba\xf1o.","english":"I wash the clothes in the washing machine in the bathroom."}},{"question":{"spanish":"\xbfTu cocina tiene un lavaplatos?","english":"Does your kitchen have a dishwasher?"},"answer":{"spanish":"S\xed, la cocina tiene un lavaplatos.","english":"Yes, the kitchen has a dishwasher."}},{"question":{"spanish":"\xbfQu\xe9 haces en el balc\xf3n?","english":"What do you do on the balcony?"},"answer":{"spanish":"Yo descanso y leo un libro en el balc\xf3n.","english":"I rest and read a book on the balcony."}},{"question":{"spanish":"\xbfD\xf3nde estudias en la casa?","english":"Where do you study in the house?"},"answer":{"spanish":"Yo estudio en el escritorio en mi dormitorio.","english":"I study at the desk in my bedroom."}},{"question":{"spanish":"\xbfQu\xe9 hay en tu comedor?","english":"What is in your dining room?"},"answer":{"spanish":"Hay una mesa y cuatro sillas.","english":"There is a table and four chairs."}},{"question":{"spanish":"\xbfQui\xe9n barre el suelo?","english":"Who sweeps the floor?"},"answer":{"spanish":"Mi hermano barre el suelo del pasillo.","english":"My brother sweeps the hallway floor."}},{"question":{"spanish":"\xbfAbres la ventana por la noche?","english":"Do you open the window at night?"},"answer":{"spanish":"S\xed, abro la ventana para que entre aire fresco.","english":"Yes, I open the window so that fresh air can come in."}},{"question":{"spanish":"\xbfQu\xe9 haces en el jard\xedn?","english":"What do you do in the garden?"},"answer":{"spanish":"Yo riego las plantas en el jard\xedn.","english":"I water the plants in the garden."}},{"question":{"spanish":"\xbfD\xf3nde est\xe1 el espejo?","english":"Where is the mirror?"},"answer":{"spanish":"El espejo est\xe1 en el ba\xf1o.","english":"The mirror is in the bathroom."}},{"question":{"spanish":"\xbfQu\xe9 hace tu padre en la casa?","english":"What does your father do in the house?"},"answer":{"spanish":"Mi padre descansa en el sof\xe1.","english":"My father rests on the sofa."}},{"question":{"spanish":"\xbfTu casa es grande o peque\xf1a?","english":"Is your house big or small?"},"answer":{"spanish":"Mi casa es grande, pero el jard\xedn es peque\xf1o.","english":"My house is big, but the garden is small."}},{"question":{"spanish":"\xbfCu\xe1ntos cuartos tiene tu casa?","english":"How many rooms does your house have?"},"answer":{"spanish":"Mi casa tiene cinco cuartos.","english":"My house has five rooms."}},{"question":{"spanish":"\xbfQu\xe9 hay en el suelo de tu sala?","english":"What is on the floor of your living room?"},"answer":{"spanish":"Hay una alfombra grande en el suelo.","english":"There is a big rug on the floor."}}]}}}')}}]);